 &lt;p&gt;Carlos C&#xe9;sar diz que Marcelo Rebelo de Sousa excedeu-se nas alegadas declara&#xe7;&#xf5;es ao seman&#xe1;rio Expresso.&lt;/p&gt; 
&lt;p&gt;O Presidente da Rep&#xfa;blica disse que n&#xe3;o aceitar&#xe1; um primeiro-ministro de substitui&#xe7;&#xe3;o de Lu&#xed;s Montenegro, caso a AD perca mas haja uma maioria de direita no Parlamento.&amp;#xa0;&lt;/p&gt; 
&lt;p&gt;O presidente do Partido Socialista afirma, no entanto, que Marcelo esteve bem no discurso que deu ao pa&#xed;s este s&#xe1;bado.&lt;/p&gt;

 &lt;p&gt;Pedro Tadeu, comentador da CNN Portugal, considera que faltou, no per&#xed;odo pr&#xe9;-eleitoral, o debate de assuntos que influenciam a vida dos portugueses, mas que, no entanto, &#x201c;d&#xe1; para chegar a uma conclus&#xe3;o de voto segura&quot;.&amp;#xa0;&lt;/p&gt; 
&lt;p&gt;&amp;#xa0;&lt;/p&gt; 
&lt;p&gt;&lt;br&gt; &amp;#xa0;&lt;/p&gt;

 &lt;p&gt;Marcelo Rebelo de Sousa fez um apelo ao voto, numa comunica&#xe7;&#xe3;o ao pa&#xed;s no s&#xe1;bado &#xe0; noite. &amp;#xa0;O Presidente da Rep&#xfa;blica destacou que se abre um novo ciclo, e que estas elei&#xe7;&#xf5;es t&#xea;m semelhan&#xe7;as com as de 2022.&lt;/p&gt; 
&lt;p&gt;A economia, sa&#xfa;de, habita&#xe7;&#xe3;o e reformas s&#xe3;o preocupa&#xe7;&#xf5;es fundamentais para o Presidente, mas a instabilidade internacional tamb&#xe9;m o preocupa.&lt;/p&gt; 
&lt;p&gt;O Presidente garantiu ainda que nenhuma institui&#xe7;&#xe3;o ou pessoa pode condicionar a vontade popular e que quem decide o futuro Governo s&#xe3;o de facto os eleitores.&lt;/p&gt;
